  [],\n\t\"revision_timestamp\": \"2016-06-20T20:47:21.339334\",\n\t\"name\": \"fire-danger-and-fire-weather-records\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Weather Service (formerly
  Weather Bureau) and Forest Service developed a program to track meteorological conditions
  conducive to forest fires, resulting in the ability to forecast and issue fire warnings
  and watches in national forests around the country. The primary variables captured
  included wet- and dry-bulb temperature along with wind direction and speed. These
  along with other basic meteorological observations enabled rangers to predict the
  likelihood of fires and establish either a Burning or Spread Index to track when
  and where forest fires were likely to occur. The archive no longer receives these
  analog observational forms.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
